import { BrowserRouter as Router, Routes, Route, useLocation } from "react-router-dom"; 
import Login from "./pages/Login"; 
import Home from "./pages/Home";
import Register from "./pages/Register";
import Medicines from "./components/Medicines";
import Navbar from "./pages/Navbar.js";
import AdminDashboard from "./components/AdminDashboard";
import UserDashboard from "./components/UserDashBoard.js";
import ListMedicines from "./pages/listMedicine.js";
import AddEditMedicine from "./pages/AddEditMedicine.js";
import AllUsers from "./pages/AllUsers.js";
import MedicineBookings from "./pages/MedicineBookings.js";
import ChangePassword from "./Userpage/Changepassword.js";
import UserProductViews from "./Userpage/userproductviews.js";
import Cart from "./pages/cart.js";

function App() {
  const location = useLocation(); // Get current route

  // Define routes where Navbar should not be displayed
  const excludedRoutes = ["/", "/Login", "/register"];
  const shouldDisplayNavbar = !excludedRoutes.includes(location.pathname);

  return (
    <div className="App">
      <Router>
        {/* Conditionally render Navbar */}
        {shouldDisplayNavbar && <Navbar />}

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/Login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/md/Medicines" element={<Medicines />} />
          <Route path="/ListMedicine" element={<ListMedicines />} />
          <Route path="/ad/AddEditMedicine" element={<AddEditMedicine />} />
          <Route path="/admin/dashboard/" element={<AdminDashboard />} />
          <Route path="/User/dashboard" element={<UserDashboard />} />
          <Route path="/User/Home" element={<Home />} />
          <Route path="/User" element={<AllUsers />} />
          <Route path="/Cart" element={<Cart />} />
          <Route path="/MedicineBookings" element={<MedicineBookings />} />
          <Route path="/UserProductViews" element={<UserProductViews />} />
          <Route path="/ChangePassword" element={<ChangePassword />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
